import React from 'react';
import './OneEvent/OneEvent.css';
import TOSLogo from "../../resources/TOSLogo.png";

class EventCard extends React.Component {
    constructor(props){
        super(props);

        this.state = {
            title : "", 
            location: "",
            month: "",
            date: "",
            time: "",
            imgurl: "https://studentevents.ucsd.edu/article_images/191028313223581.gif"
        }
    }
    render() {
        return (
            <div className="OneEventBody">
                <img src={this.state.imgurl} className="OneEventImg"/>
                <h1>hi this is</h1>
                <p>sly</p>
            </div>
        );
    }
}

export default EventCard;
